            <div class="vision-mission">
        <div class="vision">
            <h3>OUR VISION</h3>
            <p>To empower individuals to embrace their unique beauty, fostering confidence<br></br>
             and self-expression through innovative and inclusive beauty practices.</p>
        </div>
        <div class="mission">
            <h3>OUR MISSION</h3>
            <p>Our mission is to provide expert guidance, education, and personalized solutions<br></br> 
            that enhance natural beauty, promote wellness, and inspire a community of<br></br>
             beauty enthusiasts. We are dedicated to using high-quality, sustainable products <br></br>
             and promoting diverse representations of beauty.</p>
        </div>
    </div>
        </div>
    );
};
export default About;
